package dev.yafatek.models;public class CustomerAddress {	private Integer addressId;	private String street;	private String building;	private String floor;	private String cityName;	private String townName;	private CustomerModel customer;	public CustomerAddress(Integer addressId, String street, String building, String floor, String cityName, String townName, CustomerModel customer) {		this.addressId = addressId;		this.street = street;		this.building = building;		this.floor = floor;		this.cityName = cityName;		this.townName = townName;		this.customer = customer;	}	public CustomerAddress() {	}	public Integer getAddressId() {		return addressId;	}	public void setAddressId(Integer addressId) {		this.addressId = addressId;	}	public String getStreet() {		return street;	}	public void setStreet(String street) {		this.street = street;	}	public String getBuilding() {		return building;	}	public void setBuilding(String building) {		this.building = building;	}	public String getFloor() {		return floor;	}	public void setFloor(String floor) {		this.floor = floor;	}	public String getCityName() {		return cityName;	}	public void setCityName(String cityName) {		this.cityName = cityName;	}	public String getTownName() {		return townName;	}	public void setTownName(String townName) {		this.townName = townName;	}	public CustomerModel getCustomer() {		return customer;	}	public void setCustomer(CustomerModel customer) {		this.customer = customer;	}}